// CreateTask.js
import React, { useState, useEffect } from 'react';
import './CreateTask.css'; // Import your CSS file for styling

const CreateTask = () => {
  const [taskName, setTaskName] = useState('');
  const [progress, setProgress] = useState('Not Started');
  const [description, setDescription] = useState('');
  const [creationDate, setCreationDate] = useState('');
  const [dueDate, setDueDate] = useState('');
  const [priority, setPriority] = useState('Low'); // Initialize with default priority

  useEffect(() => {
    const today = new Date().toISOString().split('T')[0];
    setCreationDate(today);
  }, []);

  const handleTaskNameChange = (e) => {
    setTaskName(e.target.value);
  };

  const handleProgressChange = (e) => {
    setProgress(e.target.value);
  };

  const handleDescriptionChange = (e) => {
    setDescription(e.target.value);
  };

  const handleDueDateChange = (e) => {
    setDueDate(e.target.value);
  };

  const handlePriorityChange = (e) => {
    setPriority(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log({
      taskName,
      progress,
      description,
      creationDate,
      dueDate,
      priority,
    });
    // Optionally, you can reset form fields after submission
    setTaskName('');
    setProgress('Not Started');
    setDescription('');
    setDueDate('');
    setPriority('Low');
  };

  return (
    <div className="create-task-container">
      <h2>Create Task</h2>
      <form onSubmit={handleSubmit} className="create-task-form">
        <div className="form-group">
          <label htmlFor="taskName">Task Name:</label>
          <input
            type="text"
            id="taskName"
            name="taskName"
            value={taskName}
            onChange={handleTaskNameChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="progress">Progress on Completion:</label>
          <select
            id="progress"
            name="progress"
            value={progress}
            onChange={handleProgressChange}
            required
          >
            <option value="Not Started">Not Started</option>
            <option value="In Progress">In Progress</option>
            <option value="Needs Review">Needs Review</option>
            <option value="Done">Done</option>
          </select>
        </div>
        <div className="form-group">
          <label htmlFor="description">Description:</label>
          <textarea
            id="description"
            name="description"
            value={description}
            onChange={handleDescriptionChange}
            rows={4}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="creationDate">Creation Date:</label>
          <input
            type="date"
            id="creationDate"
            name="creationDate"
            value={creationDate}
            readOnly
          />
        </div>
        <div className="form-group">
          <label htmlFor="dueDate">Due Date:</label>
          <input
            type="date"
            id="dueDate"
            name="dueDate"
            value={dueDate}
            onChange={handleDueDateChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="priority">Priority:</label>
          <select
            id="priority"
            name="priority"
            value={priority}
            onChange={handlePriorityChange}
            required
          >
            <option value="Low">Low</option>
            <option value="Medium">Medium</option>
            <option value="High">High</option>
            <option value="Critical">Critical</option>
          </select>
        </div>
        <button type="submit">Create</button>
      </form>
    </div>
  );
};

export default CreateTask;
